import React, {Component} from 'react'

class Scroll extends Component{
    render(){
        const forLoop = length => {
            let dot = [];
            for (let i = 0; i < length; i++) {

              dot.push(<li ><span className="circle"></span></li>);
            }
            return dot;
          };

        return(
            <div className="nav">
                <ul>
                    {forLoop(this.props.length)}
                </ul>
            </div>
        )

    }
}
export default Scroll
